import React from "react";


function App() {
  return (
    <div className="alert alert-dismissible alert-success">
      <button type="button" className="btn-close" data-bs-dismiss="alert"></button>
      <strong>Muito Bem, Hello Bootswatch !</strong> Você agora pode cadastrar <a href="https//google.com.br" className="alert-link">Isto é uma mensagem de alert verde</a>.
    </div>
  );
}

export default App;
